import { NavLink, Outlet } from "react-router-dom";
function NavBar() {
  return (
    <div className="NavBar">
      <nav className="d-flex justify-content-around my-5">
        <NavLink className='navlink' activeClassName='active' to='/'>Home</NavLink>
        <NavLink className='navlink' activeClassName='active' to='/gallery'>Gallery</NavLink>
        <NavLink className='navlink' activeClassName='active' to='/axiospage'>AxiosPage</NavLink>
        <NavLink className='navlink' activeClassName='active' to='/about'>About</NavLink>
      </nav>
      <Outlet />
      <footer>
        <nav className="navbar navbar-expand-sm bg-dark navbar-dark d-flex nav nav-tabs justify-content-around my-5">
          <NavLink className='navlink' activeClassName='active' to='/'>Home</NavLink>
          <NavLink className='navlink' activeClassName='active' to='/gallery'>Gallery</NavLink>
          <NavLink className='navlink' activeClassName='active' to='/axiospage'>AxiosPage</NavLink>
          <NavLink className='navlink' activeClassName='active' to='/about'>About</NavLink>
        </nav>
      </footer>
    </div>
  );
}

export default NavBar;
